import React from 'react';
import { Dimensions, StyleSheet, Text, View } from 'react-native';
import { TextInput, TouchableHighlight } from 'react-native-gesture-handler';
// import { get } from 'react-native/Libraries/Utilities/PixelRatio';

function createDates({ navigation }) {
    return (
        <View style={styles.container}>
            <TextInput style={styles.textInput} placeholder="Identificacion"></TextInput>
            <TextInput style={styles.textInput} placeholder="Nombre"></TextInput>
            <TextInput style={styles.textInput} placeholder="Apellido"></TextInput>
            <TextInput style={styles.textInput} placeholder="Fecha de nacimiento"></TextInput>
            <TextInput style={styles.textInput} placeholder="Ciudad"></TextInput>
            <TextInput style={styles.textInput} placeholder="Barrio"></TextInput>
            <TextInput style={styles.textInput} placeholder="Telefono"></TextInput>
            <TouchableHighlight style={styles.styleButton} onPress={() => navigation.navigate('create')}>
                <Text style={styles.textCreateButton}>Create Dates</Text>
            </TouchableHighlight>
        </View>
    );
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: '#fff',
        flexDirection: 'column',
        alignItems: 'center'
    },
    textInput: {
        marginTop: 10,
        padding: 15,
        borderColor: 'black',
        borderRadius: 5,
        borderWidth: 1,
        width: Dimensions.get('screen').width * 0.9
    },
    styleButton:{
        backgroundColor:'blue',
        padding: 15,
        alignItems: 'center',
        marginTop:5,
        borderRadius:20
    },
    textCreateButton: {
      color:'white'
    }
});

export default createDates;
